import React from "react";
import "./Hero.css";
import Header from "./Header/Header";
const Hero = () => {
  return (
    <div className="hero">
      <div className="left-h">
        <Header /> {/* the best ad*/}{" "}
        <div className="the-best-ad">
          <div> </div> <span> The Best Fitness Club in Town </span>{" "}
        </div>{" "}
        {/ * hero heading * /}{" "}
        <div className="hero-text">
          <div>
            <span className="stroke-text"> Shape </span> <span> Your </span>{" "}
          </div>{" "}
          <div>
            {" "}
            <span> Ideal Body </span>{" "}
          </div>{" "}
          <div>
            <span>
              {" "}
              in here we wil help you to shape adn build your ideal body and
              live up your life to fullest{" "}
            </span>{" "}
          </div>{" "}
        </div>{" "}
        {/ * Figures * /}{" "}
        <div className="figures">
          <div>
            {" "}
            <span> +140 </span> <span> Expert coaches</span>
          </div>{" "}
          <div>
            {" "}
            <span> +978 </span> <span> Members Joined</span>
          </div>{" "}
          <div>
            {" "}
            <span> +50 </span> <span>Fittness programs</span>
          </div>{" "}
        </div>{" "}
        {/* hero buttons */}{" "}
        <div className="hero-buttons">
          <buttons className="btn"> Get Started </buttons>{" "}
          <buttons className="btn"> Learn More </buttons>{" "}
        </div>{" "}
      </div>{" "}
      <div className="right-h"> right side </div>{" "}
    </div>
  );
};
export default Hero;
